import { Container, Typography, FormControl,
        FormControlLabel, FormLabel, RadioGroup,
        Radio, Button
} from '@material-ui/core'
import { useState } from 'react'

const Test4 = () =>{

    const [gender, setGender] = useState('')

    const handleSubmit = (e) =>{
        e.preventDefault()
        console.log(gender)
    }

    return(
        <Container>
            <Typography variant="h3" align="center">Radio Buttons</Typography>

            <form onSubmit={handleSubmit}>
                <FormControl>
                    <FormLabel>Gender</FormLabel>
                    <RadioGroup value={gender} onChange={(e)=> setGender(e.target.value)}>
                        <FormControlLabel label="Male" value="male" control={<Radio/>}/>
                        <FormControlLabel label="Female" value="female" control={<Radio/>}/>
                    </RadioGroup>
                </FormControl>

                <FormControl>
                    <Button variant="outlined" color="secondary" type="submit">Submit</Button>
                </FormControl>
            </form>



        </Container>
    )
}

export default Test4
